import React from 'react';
import './VehiclesDetails.cs'; // Import your CSS file

// Sample data for vehicles
const vehicles = [
  {
    id: 1,
    type: 'Sedan',
    name: 'Toyota Camry',
    engine: '2.5L 4-Cylinder',
    imgSrc: '/assets/cars/toyota-camry.jpg',
    features: ['Free Cancellation', 'Free Insurance']
  },
  {
    id: 2,
    type: 'SUV',
    name: 'Nissan Rogue',
    engine: '2.5L 4-Cylinder',
    imgSrc: '/assets/cars/nissan-rogue.jpg',
    features: ['Free Cancellation', 'Free Insurance']
  },
  {
    id: 3,
    type: 'Sports',
    name: 'Ford Mustang',
    engine: '5.0L V8',
    imgSrc: '/assets/cars/ford-mustang.jpg',
    features: ['Free Cancellation', 'Free Insurance']
  },
  {
    id: 4,
    type: '7-Seater',
    name: 'Honda Odyssey',
    engine: '3.5L V6',
    imgSrc: '/assets/cars/honda-odyssey.jpg',
    features: ['Free Cancellation', 'Free Insurance']
  },
];

const VehiclesDetails = () => {
  return (
    <div className="vehicles-details">
      <h2>Our Vehicles</h2>
      
      {/* Loop through the types of vehicles */}
      {['Sedan', 'SUV', 'Sports', '7-Seater'].map((type) => (
        <div key={type} className="vehicle-section">
          <h3>{type}s</h3>
          <div className="vehicle-cards-container">
            {vehicles
              .filter(vehicle => vehicle.type === type) // Filter vehicles by type
              .map(vehicle => (
                <div key={vehicle.id} className="vehicle-card">
                  <img src={vehicle.imgSrc} alt={vehicle.name} className="vehicle-image" />
                  <h4 className="vehicle-name">{vehicle.name}</h4>
                  <p className="vehicle-engine">Engine: {vehicle.engine}</p>
                  <div className="vehicle-features">
                    {vehicle.features.map((feature, index) => (
                      <span key={index} className="feature">{feature}</span>
                    ))}
                  </div>
                </div>
              ))}
          </div>
        </div>
      ))}
    </div>
  );
};

export default VehiclesDetails;
